import React, { useState } from 'react';
import { Lock, CheckCircle, XCircle, AlertTriangle, Loader, Search } from 'lucide-react';
import FileUpload from '../components/FileUpload';
import { sessionAPI } from '../services/api';
import toast from 'react-hot-toast';

const AuthCodeExtractor = () => {
  const [files, setFiles] = useState([]);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleFilesSelected = (selectedFiles) => {
    setFiles(selectedFiles);
    setResults([]);
  };

  const handleExtractAuthCodes = async () => {
    if (files.length === 0) {
      toast.error('Please select session files');
      return;
    }

    setLoading(true);
    try {
      const response = await sessionAPI.extractAuthCodes(files);
      setResults(response.results);
      toast.success(`Extracted auth codes from ${response.total_sessions} sessions`);
    } catch (error) {
      console.error('Auth code extraction error:', error);
      toast.error('Failed to extract auth codes. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'success':
        return <CheckCircle className="h-5 w-5 text-green-500" />;
      case 'error':
        return <XCircle className="h-5 w-5 text-red-500" />;
      case 'unauthorized':
        return <AlertTriangle className="h-5 w-5 text-yellow-500" />;
      default:
        return <AlertTriangle className="h-5 w-5 text-gray-500" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'success':
        return 'status-success';
      case 'error':
        return 'status-error';
      case 'unauthorized':
        return 'status-warning';
      default:
        return 'status-info';
    }
  };

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center space-x-3">
        <Lock className="h-8 w-8 text-telegram-500" />
        <div>
          <h1 className="text-3xl font-bold text-gray-900">Auth Codes</h1>
          <p className="text-gray-600">Extract authentication codes from my.telegram.org messages</p>
        </div>
      </div>

      {/* Info Card */}
      <div className="card bg-blue-50 border-blue-200">
        <div className="flex items-start space-x-3">
          <Search className="h-6 w-6 text-blue-600 mt-0.5" />
          <div>
            <h3 className="font-medium text-blue-900">How it works</h3>
            <p className="text-sm text-blue-700 mt-1">
              This tool searches for authentication codes from my.telegram.org messages, 
              official Telegram accounts, and saved messages. It looks for long alphanumeric 
              strings that are typically used for API authentication.
            </p>
          </div>
        </div>
      </div>

      {/* File Upload */}
      <div className="card">
        <h2 className="text-lg font-semibold text-gray-900 mb-4">Upload Session Files</h2>
        <FileUpload
          onFilesSelected={handleFilesSelected}
          acceptedFileTypes={['.session']}
          title="Upload Session Files"
          description="Drag & drop .session files here, or click to select files"
        />
      </div>

      {/* Extract Button */}
      {files.length > 0 && (
        <div className="flex justify-center">
          <button
            onClick={handleExtractAuthCodes}
            disabled={loading}
            className="btn-primary flex items-center space-x-2 px-8 py-3 text-lg"
          >
            {loading ? (
              <>
                <Loader className="h-5 w-5 animate-spin" />
                <span>Extracting Auth Codes...</span>
              </>
            ) : (
              <>
                <Lock className="h-5 w-5" />
                <span>Extract Auth Codes</span>
              </>
            )}
          </button>
        </div>
      )}

      {/* Results */}
      {results.length > 0 && (
        <div className="card">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">
            Extraction Results ({results.length} sessions)
          </h2>
          
          <div className="space-y-4">
            {results.map((result, index) => (
              <div
                key={index}
                className={`p-4 rounded-lg border ${getStatusColor(result.status)}`}
              >
                <div className="flex items-center justify-between">
                  <div className="flex items-center space-x-3">
                    {getStatusIcon(result.status)}
                    <div>
                      <h3 className="font-medium text-gray-900">{result.session}</h3>
                      <p className="text-sm text-gray-600">
                        Status: {result.status.charAt(0).toUpperCase() + result.status.slice(1)}
                      </p>
                    </div>
                  </div>
                  
                  {result.status === 'success' && (
                    <div className="text-right">
                      <p className="text-sm font-medium text-gray-900">
                        User ID: {result.user_id}
                      </p>
                      <p className="text-sm text-gray-600">
                        Auth Codes Found: {result.auth_codes_found}
                      </p>
                    </div>
                  )}
                </div>

                {result.status === 'success' && result.auth_codes && result.auth_codes.length > 0 && (
                  <div className="mt-4">
                    <h4 className="text-sm font-medium text-gray-900 mb-2">Found Auth Codes:</h4>
                    <div className="space-y-2">
                      {result.auth_codes.map((code, codeIndex) => (
                        <div key={codeIndex} className="p-3 bg-gray-50 rounded-lg">
                          <div className="flex items-center justify-between">
                            <div className="flex-1">
                              <p className="font-mono text-sm font-medium text-gray-900 break-all">
                                {code.code}
                              </p>
                              <p className="text-xs text-gray-600">
                                Source: {code.source}
                              </p>
                              {code.message_preview && (
                                <p className="text-xs text-gray-500 mt-1">
                                  {code.message_preview}
                                </p>
                              )}
                            </div>
                            <div className="text-right ml-4">
                              {code.date && (
                                <p className="text-xs text-gray-500">
                                  {new Date(code.date).toLocaleDateString()}
                                </p>
                              )}
                              <p className="text-xs text-gray-500">
                                ID: {code.message_id}
                              </p>
                            </div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                )}

                {result.status === 'error' && (
                  <div className="mt-3">
                    <p className="text-sm font-medium text-gray-900">
                      Error: {result.error}
                    </p>
                    {result.error_type && (
                      <p className="text-xs text-gray-600 mt-1">
                        Type: {result.error_type}
                      </p>
                    )}
                  </div>
                )}

                {result.status === 'unauthorized' && (
                  <div className="mt-3">
                    <p className="text-sm text-gray-600">
                      This session is not authorized. Please check if the session file is valid.
                    </p>
                  </div>
                )}
              </div>
            ))}
          </div>

          {/* Summary */}
          <div className="mt-6 p-4 bg-gray-50 rounded-lg">
            <h3 className="font-medium text-gray-900 mb-2">Summary</h3>
            <div className="grid grid-cols-2 gap-4 text-sm">
              <div>
                <span className="text-gray-600">Total Sessions:</span>
                <span className="ml-2 font-medium">{results.length}</span>
              </div>
              <div>
                <span className="text-gray-600">Successful Extractions:</span>
                <span className="ml-2 font-medium text-green-600">
                  {results.filter(r => r.status === 'success').length}
                </span>
              </div>
              <div>
                <span className="text-gray-600">Total Auth Codes Found:</span>
                <span className="ml-2 font-medium text-blue-600">
                  {results.reduce((total, r) => total + (r.auth_codes_found || 0), 0)}
                </span>
              </div>
              <div>
                <span className="text-gray-600">Errors:</span>
                <span className="ml-2 font-medium text-red-600">
                  {results.filter(r => r.status === 'error').length}
                </span>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AuthCodeExtractor;
